def parse():
    """
    Method to create a parser for command-line options
    """
    parser = argparse.ArgumentParser(description="A SCRIPT TO OBTAIN SPECIFIC EXON JUNCTION NOT KNOWN IN ENSEMBL.")
    # Create command-line parser for all options and arguments to give
    
    parser.add_argument("-g", "--genes",
                        dest = "gene_test",
                        metavar = "GENE ENSEMBL ID TESTED",
                        help = "Give a gene Ensembl id to test the programm.",
                        required = True)
    
    parser.add_argument("-f", "--file",
                        dest = "gtf_file",
                        metavar = "GTF FILE",
                        default = "/home/niguilla/Documents/Software/gtf_validator_of_cgalcode_prediction/examples/reference_gtf/human/ensembl/Ensembl103/Homo_sapiens.GRCh38.103.gtf",
                        help = "Give a gtf file to extract the set of data used in the study. This file should indicates the gene reference in each line description",
                        required = True)
    
    
    return parser.parse_args()       
    
